Answer: C and C++ both lack concepts like 'cache'. Even in C++11 we have to make use of data-oriented concepts:
\begin{itemize}
\item a class has a member (data)-field
\item a class has a member (method) function
\end{itemize}

In other words: in any implementation of languages like C++ objects and classes always must have data-fields. And also most methods have to access data-fields by reference or pointer (for efficiency reasons). The idea is: we can get any data field simply by addressing its address. But since most data is stored in the RAM memory, the efficiency of such an approach is not very good. The problem is we can't avoid addressing objects by address (data-field of an object), so the main advantage (efficiency advantage) is lost, and all (most) data-operations also will consume 'memory band-width', which is even worse!

That is why we nowadays use concepts like 'heap' and 'cache', just for memory efficiency. And because such concepts also are quite new, they don't exist in all programming languages with objects. The only 'object' programming language that has such 'concepts' is Java. So if you want to use concepts like 'heap' and/or 'cache' it helps to avoid to use C++ (and then 'convenient' C++ compilers or code generators like Intel, Clang, ...).

So the answer to your question: Because: you are trying to use 'concepts' (memory concepts) that don't exist in languages like C++. And also: there is a 'problem' that C++ is: even in C++11 - also a 'memory-conscious language' or a 'memory-oriented language'. In other words: C++ doesn't have enough 'abstract concepts' (it has only very limited) - so it is only a (kind of limited) 'concrete language'.

So the answer to your question: you will experience the problems of such a language (C++), when you also try to use 'abstract concepts' (like the more modern concepts that are available in Java).

