	vector<vector<int>> diagonal_order(vector<vector<int>> &mat) {
		vector<vector<int>> res;
		int m = mat.size();
		int n = mat[0].size();
		int maxIndex = max(m,n);

		//res = mat;
		for (int i = 0; i < m; i++) {
			for (int j = 0; j < n; j++)
				if (mat[i][j] > 0) {
					res[i].push_back(mat[i][j]);
				}
		}

		for (int i = 0; i < m; i++) {
			for (int j = 0; j < n; j++)
				if (res[i][j] > 0)
					if (res[i][j] == i+j)
						res[i][j]++; //change mat[i][j - 1] to di[i]
					else
						res[i][j] --; //change mat[i][j] to di[i + 1]

			for (int j = 0; j < n; j++) {
				for (int i = 0; i < maxIndex - j - 1; i++)
					if (i != 0 && mat[i][j] == 0 && res[i + 1][j] == 0)
						res[i + 1][j] = i + j;//change mat [i + 1][j] to di [i + 1]
			}
		}

		for (int i = 0; i < maxIndex; i++)
			if (res[i].size() > 0)
				res.push_back(res[i]);

		for (int i = 0, k = 0; i < maxIndex;)
			if (res[k].size() > 0)
				if (res[k][0] + 2 > m)
					res[k].erase(res[k].begin() + 1);
				else
					res[++k] = res[k];

		for (int i = 0; i < maxIndex; i++)
			for (int j = 0; j < m; j++)
				for (int k = 0; k < n; k++)
					mat[j][k] = res[i][j].back();
		return res;
	}
}

